import React from 'react';
import logo from './logo.svg';
import './App.css';

function HiddenCode(props) {
  return (
    <pre className='HiddenCode'>
      {props.code}
    </pre>
  )
}

function Welcome() {
  return (
    <div className='Welcome'>
      Welcome to the game.
    </div>
  )
}

function AccessCode(props) {
  function handleSubmit (event) {
    event.preventDefault();
  }

  return (
    <form className='AccessCode' onSubmit={handleSubmit}>
      <input type='text' placeholder='Access Code' required/>
      <button>Enter</button>
    </form>
  )
}

function App() {
  let randomNum = Math.floor(Math.random()*100000000);

  return (
    <div className='App'>
      <HiddenCode code={randomNum}/>
      <div className='Welcome'>Welcome to the game.</div>
      <AccessCode code={randomNum} />
    </div>
  );
}

export default App;
